import React from 'react';
import "../../Asserts/Css/Pages/studyinusamba.css";
import Header from '../../Components/header';
import Footer from '../../Components/footer';
import Navbar from '../../Components/navbar';
import StudyAbroad from '../../Components/StudyAbroad';
import YourNextStep from '../../Components/YourNextStep';


const StudyinUSAMBA = ()=>{
    return (
       

        <div className='StudyinUSAMBApage'>
              <Header></Header>
              <Navbar></Navbar>
              <StudyAbroad></StudyAbroad>
            <h1 className=''>Study in USA</h1>
             <h2>MBA IN USA</h2>
             <p>The USA is considered to be the birthplace of professional management. While it is possible that other countries might have professional management at different stages of their evolution, aggressively promoting the field of management practice and education has been highlighted by the US. Naturally, the study of business management at various levels has also been pioneered by US universities, which started educating managers of all nationalities for the future.

</p>



<YourNextStep></YourNextStep>
           <Footer></Footer>
              </div>
    )
}

export default StudyinUSAMBA ;
